Upstream Issue: https://github.com/microsoft/language-server-protocol/issues/724 Experimental Client Capability: { "snippetTextEdit": boolean } If this capability is set, WorkspaceEdits returned from codeAction requests and TextEdits returned from textDocument/onTypeFormatting requests might contain SnippetTextEdits instead of usual TextEdits: interface SnippetTextEdit extends TextEdit { insertTextFormat?: InsertTextFormat; annotationId?: ChangeAnnotationIdentifier;
} export interface TextDocumentEdit { textDocument: OptionalVersionedTextDocumentIdentifier; edits: (TextEdit | SnippetTextEdit)[];
} When applying such code action or text edit, the editor should insert snippet, with tab stops and placeholder. At the moment, rust-analyzer guarantees that only a single edit will have InsertTextFormat.Snippet. Example "Add derive" code action transforms struct S; into #[derive($0)] struct S; Unresolved Questions Where exactly are SnippetTextEdits allowed (only in code actions at the moment)? Can snippets span multiple files (so far, no)?

