Upstream Issue: https://github.com/microsoft/language-server-protocol/issues/1002 Experimental Server Capability: { "parentModule": boolean } This request is sent from client to server to handle "Goto Parent Module" editor action. Method: experimental/parentModule Request: TextDocumentPositionParams Response: Location | Location[] | LocationLink[] | null Example // src/main.rs
mod foo;
// src/foo.rs /* cursor here*/ experimental/parentModule returns a single Link to the mod foo; declaration. Unresolved Question An alternative would be to use a more general "gotoSuper" request, which would work for super methods, super classes and super modules. This is the approach IntelliJ Rust is taking. However, experience shows that super module (which generally has a feeling of navigation between files) should be separate. If you want super module, but the cursor happens to be inside an overridden function, the behavior with single "gotoSuper" request is surprising.

