Experimental Client Capability: { "serverStatusNotification": boolean } Method: experimental/serverStatus Notification: interface ServerStatusParams { /// `ok` means that the server is completely functional. /// /// `warning` means that the server is partially functional. /// It can answer correctly to most requests, but some results /// might be wrong due to, for example, some missing dependencies. /// /// `error` means that the server is not functional. For example, /// there's a fatal build configuration problem. The server might /// still give correct answers to simple requests, but most results /// will be incomplete or wrong. health: "ok" | "warning" | "error", /// Is there any pending background work which might change the status? /// For example, are dependencies being downloaded? quiescent: boolean, /// Explanatory message to show on hover. message?: string,
} This notification is sent from server to client. The client can use it to display persistent status to the user (in modline). It is similar to the showMessage, but is intended for stares rather than point-in-time events. Note that this functionality is intended primarily to inform the end user about the state of the server. In particular, it's valid for the client to completely ignore this extension. Clients are discouraged from but are allowed to use the health status to decide if it's worth sending a request to the server. Controlling Flycheck The flycheck/checkOnSave feature can be controlled via notifications sent by the client to the server. Method: rust-analyzer/runFlycheck Notification: interface RunFlycheckParams { /// The text document whose cargo workspace flycheck process should be started. /// If the document is null or does not belong to a cargo workspace all flycheck processes will be started. textDocument: lc.TextDocumentIdentifier | null;
} Triggers the flycheck processes. Method: rust-analyzer/clearFlycheck Notification: interface ClearFlycheckParams {} Clears the flycheck diagnostics. Method: rust-analyzer/cancelFlycheck Notification: interface CancelFlycheckParams {} Cancels all running flycheck processes.

