s gif for the cases handled specially by joined lines. Editor Action Name VS Code rust-analyzer: Join lines Join Lines Magic Completions Source: lib.rs In addition to usual reference completion, rust-analyzer provides some âœ¨magicâœ¨ completions as well: Keywords like if, else while, loop are completed with braces, and cursor is placed at the appropriate position. Even though if is easy to type, you still want to complete it, to get { } for free! return is inserted with a space or ; depending on the return type of the function. When completing a function call, () are automatically inserted. If a function takes arguments, the cursor is positioned inside the parenthesis. There are postfix completions, which can be triggered by typing something like foo().if. The word after . determines postfix completion. Possible variants are: expr.if -> if expr {} or if let ... {} for Option or Result expr.match -> match expr {} expr.while -> while expr {} or while let ... {} for Option or Result expr.ref -> &expr expr.refm -> &mut expr expr.let -> let $0 = expr; expr.letm -> let mut $0 = expr; expr.not -> !expr expr.dbg -> dbg!(expr) expr.dbgr -> dbg!(&expr) expr.call -> (expr) There also snippet completions: Expressions pd -> eprintln!(" = {:?}", ); ppd -> eprintln!(" = {:#?}", ); Items tfn -> #[test] fn feature(){} tmod -> #[cfg(test)]
mod tests { use super::*; #[test] fn test_name() {}
} And the auto import completions, enabled with the rust-analyzer.completion.autoimport.enable setting and the corresponding LSP client capabilities. Those are the additional completion options with automatic use import and options from all project importable items, fuzzy matched against the completion input. Magic Completions Matching Brace Source: matching_brace.rs If the cursor is on any brace (<>(){}[]||) which is a part of a brace-pair, moves cursor to the matching brace. It uses the actual parser to determine braces, so it won't confuse generics with comparisons. Editor Action Name VS Code rust-analyzer: Find matching brace Matching Brace Memory Usage Source: apply_change.rs Clears rust-analyzer's internal database and prints memory usage statistics. Editor Action Name VS Code rust-analyzer: Memory Usage (Clears Database) Memory Usage Move Item Source: move_item.rs Move item under cursor or selection up and down. Editor Action Name VS Code rust-analyzer: Move item up VS Code rust-analyzer: Move item down Move Item On Enter Source: on_enter.rs rust-analyzer can override kbd:[Enter] key to make it smarter: Enter inside triple-slash comments automatically inserts /// Enter in the middle or after a trailing space in // inserts // Enter inside //! doc comments automatically inserts //! Enter after { indents contents and closing } of single-line block This action needs to be assigned to shortcut explicitly. Note that, depending on the other installed extensions, this feature can visibly slow down typing. Similarly, if rust-analyzer crashes or stops responding, Enter might not work. In that case, you can still press Shift-Enter to insert a newline. VS Code:: Add the following to keybindings.json: { "key": "Enter", "command": "rust-analyzer.onEnter", "when": "editorTextFocus && !suggestWidgetVisible && editorLangId == rust"
} When using the Vim plugin: { "key": "Enter", "command": "rust-analyzer.onEnter", "when": "editorTextFocus && !suggestWidgetVisible && editorLangId == rust && vim.mode == 'Insert'"
} On Enter On Typing Assists Source: typing.rs Some features trigger on typing certain characters: typing let = tries to smartly add ; if = is followed by an existing expression typing = between two expressions adds ; when in statement position typing = to turn an assignment into an equality comparison removes ; when in expression position typing . in a chain method call auto-indents typing { in front of an expression inserts a closing } after the expression typing { in a use item adds a closing } in the right place VS Code Add the following to settings.json: "editor.formatOnType": true, Typing Typing Open Docs Source: doc_links.rs Retrieve a links to documentation for the given symbol. The simplest way to use this feature is via the context menu. Right-click on the selected item. The context menu opens. Select Open Docs . Editor Action Name VS Code rust-analyzer: Open Docs Parent Module Source: parent_module.rs Navigates to the parent module of the current module. Editor Action Name VS Code rust-analyzer: Locate parent module Parent Module Related Tests Source: runnables.rs Provides a sneak peek of all tests where the current item is used. The simplest way to use this feature is via the context menu. Right-click on the selected item. The context menu opens. Select Peek Related Tests . Editor Action Name VS Code rust-analyzer: Peek Related Tests Rename Source: rename.rs Renames the item below the cursor and all of its references Editor Shortcut VS Code F2 Rename Run Source: runnables.rs Shows a popup suggesting to run a test/benchmark/binary at the current cursor location . Super useful for repeatedly running just a single test. Do bind this to a shortcut! Editor Action Name VS Code rust-analyzer: Run Run Semantic Syntax Highlighting Source: syntax_highlighting.rs rust-analyzer highlights the code semantically. For example, Bar in foo::Bar might be colored differently depending on whether Bar is an enum or a trait. rust-analyzer does not specify colors directly, instead it assigns a tag (like struct) and a set of modifiers (like declaration) to each token. It's up to the client to map those to specific colors. The general rule is that a reference to an entity gets colored the same way as the entity itself. We also give special modifier for mut and &mut local variables. Token Tags Rust-analyzer currently emits the following token tags: For items: attribute Emitted for attribute macros. enum Emitted for enums. function Emitted for free-standing functions. derive Emitted for derive macros. macro Emitted for function-like macros. method Emitted for associated functions, also knowns as methods. namespace Emitted for modules. struct Emitted for structs. trait Emitted for traits. typeAlias Emitted for type aliases and Self in impls. union Emitted for unions. For literals: boolean Emitted for the boolean literals true and false. character Emitted for character literals. number Emitted for numeric literals. string Emitted for string literals. escapeSequence Emitted for escaped sequences inside strings like \n. formatSpecifier Emitted for format specifiers {:?} in format!-like macros. For operators: operator Emitted for general operators. arithmetic Emitted for the arithmetic operators +, -, *, /, +=, -=, *=, /=. bitwise Emitted for the bitwise operators \|, &, !, ^, \|=, &=, ^=. comparison Emitted for the comparison operators >, <, ==, >=, <=, !=. logical Emitted for the logical operators \|\|, &&, !. For punctuation: punctuation Emitted for general punctuation. attributeBracket Emitted for attribute invocation brackets, that is the #[ and ] tokens. angle Emitted for <> angle brackets. brace Emitted for {} braces. bracket Emitted for [] brackets. parenthesis Emitted for () parentheses. colon Emitted for the : token. comma Emitted for the , token. dot Emitted for the . token. semi Emitted for the ; token. macroBang Emitted for the ! token in macro calls. builtinAttribute Emitted for names to builtin attributes in attribute path, the repr in #[repr(u8)] for example. builtinType Emitted for builtin types like u32, str and f32. comment Emitted for comments. constParameter Emitted for const parameters. deriveHelper Emitted for derive helper attributes. enumMember Emitted for enum variants. generic Emitted for generic tokens that have no mapping. keyword Emitted for keywords. label Emitted for labels. lifetime Emitted for lifetimes. parameter Emitted for non-self function parameters. property Emitted for struct and union fields. selfKeyword Emitted for the self function parameter and self path-specifier. selfTypeKeyword Emitted for the Self type parameter. toolModule Emitted for tool modules. typeParameter Emitted for type parameters. unresolvedReference Emitted for unresolved references, names that rust-analyzer can't find the definition of. variable Emitted for locals, constants and statics. Token Modifiers Token modifiers allow to style some elements in the source code more precisely. Rust-analyzer currently emits the following token modifiers: async Emitted for async functions and the async and await keywords. attribute Emitted for tokens inside attributes. callable Emitted for locals whose types implements one of the Fn* traits. constant Emitted for consts. consuming Emitted for locals that are being consumed when use in a function call. controlFlow Emitted for control-flow related tokens, this includes the ? operator. crateRoot Emitted for crate names, like serde and crate. declaration Emitted for names of definitions, like foo in fn foo() {}. defaultLibrary Emitted for items from built-in crates (std, core, alloc, test and proc_macro). documentation Emitted for documentation comments. injected Emitted for doc-string injected highlighting like rust source blocks in documentation. intraDocLink Emitted for intra doc links in doc-strings. library Emitted for items that are defined outside of the current crate. macro Emitted for tokens inside macro calls. mutable Emitted for mutable locals and statics as well as functions taking &mut self. public Emitted for items that are from the current crate and are pub. reference Emitted for locals behind a reference and functions taking self by reference. static Emitted for "static" functions, also known as functions that do not take a self param, as well as statics and consts. trait Emitted for associated trait items. unsafe Emitted for unsafe operations, like unsafe function calls, as well as the unsafe token. Semantic Syntax Highlighting Semantic Syntax Highlighting Show Dependency Tree Source: fetch_crates.rs Shows a view tree with all the dependencies of this project Editor Panel Name VS Code Rust Dependencies Show Dependency Tree Show Syntax Tree Source: syntax_tree.rs Shows the parse tree of the current file. It exists mostly for debugging rust-analyzer itself. Editor Action Name VS Code rust-analyzer: Show Syntax Tree Show Syntax Tree Shuffle Crate Graph Source: shuffle_crate_graph.rs Randomizes all crate IDs in the crate graph, for debugging. Editor Action Name VS Code rust-analyzer: Shuffle Crate Graph Status Source: status.rs Shows internal statistic about memory usage of rust-analyzer. Editor Action Name VS Code rust-analyzer: Status Status Structural Search and Replace Source: lib.rs Search and replace with named wildcards that will match any expression, type, path, pattern or item. The syntax for a structural search replace command is <search_pattern> ==>> <replace_pattern>. A $<name> placeholder in the search pattern will match any AST node and $<name> will reference it in the replacement. Within a macro call, a placeholder will match up until whatever token follows the placeholder. All paths in both the search pattern and the replacement template must resolve in the context in which this command is invoked. Paths in the search pattern will then match the code if they resolve to the same item, even if they're written differently. For example if we invoke the command in the module foo with a pattern of Bar, then code in the parent module that refers to foo::Bar will match. Paths in the replacement template will be rendered appropriately for the context in which the replacement occurs. For example if our replacement template is foo::Bar and we match some code in the foo module, we'll insert just Bar. Inherent method calls should generally be written in UFCS form. e.g. foo::Bar::baz($s, $a) will match $s.baz($a), provided the method call baz resolves to the method foo::Bar::baz. When a placeholder is the receiver of a method call in the search pattern (e.g. $s.foo()), but not in the replacement template (e.g. bar($s)), then *, & and &mut will be added as needed to mirror whatever autoderef and autoref was happening implicitly in the matched code. The scope of the search / replace will be restricted to the current selection if any, otherwise it will apply to the whole workspace. Placeholders may be given constraints by writing them as ${<name>:<constraint1>:<constraint2>...}. Supported constraints: Constraint Restricts placeholder kind(literal) Is a literal (e.g. 42 or "forty two") not(a) Negates the constraint a Available via the command rust-analyzer.ssr. // Using structural search replace command [foo($a, $b) ==>> ($a).foo($b)] // BEFORE
String::from(foo(y + 5, z)) // AFTER
String::from((y + 5).foo(z)) Editor Action Name VS Code rust-analyzer: Structural Search Replace Also available as an assist, by writing a comment containing the structural search and replace rule. You will only see the assist if the comment can be parsed as a valid structural search and replace rule. // Place the cursor on the line below to see the assist ðŸ’¡.
// foo($a, $b) ==>> ($a).foo($b) User Snippet Completions Source: snippet.rs rust-analyzer allows the user to define custom (postfix)-snippets that may depend on items to be accessible for the current scope to be applicable. A custom snippet can be defined by adding it to the rust-analyzer.completion.snippets.custom object respectively. { "rust-analyzer.completion.snippets.custom": { "thread spawn": { "prefix": ["spawn", "tspawn"], "body": [ "thread::spawn(move || {", "\t$0", "});", ], "description": "Insert a thread::spawn call", "requires": "std::thread", "scope": "expr", } }
} In the example above: "thread spawn" is the name of the snippet. prefix defines one or more trigger words that will trigger the snippets completion. Using postfix will instead create a postfix snippet. body is one or more lines of content joined via newlines for the final output. description is an optional description of the snippet, if unset the snippet name will be used. requires is an optional list of item paths that have to be resolvable in the current crate where the completion is rendered. On failure of resolution the snippet won't be applicable, otherwise the snippet will insert an import for the items on insertion if the items aren't yet in scope. scope is an optional filter for when the snippet should be applicable. Possible values are: ** for Snippet-Scopes: expr, item (default: item) ** for Postfix-Snippet-Scopes: expr, type (default: expr) The body field also has access to placeholders as visible in the example as $0. These placeholders take the form of $number or ${number:placeholder_text} which can be traversed as tabstop in ascending order starting from 1, with $0 being a special case that always comes last. There is also a special placeholder, ${receiver}, which will be replaced by the receiver expression for postfix snippets, or a $0 tabstop in case of normal snippets. This replacement for normal snippets allows you to reuse a snippet for both post- and prefix in a single definition. For the VSCode editor, rust-analyzer also ships with a small set of defaults which can be removed by overwriting the settings object mentioned above, the defaults are: { "Arc::new": { "postfix": "arc", "body": "Arc::new(${receiver})", "requires": "std::sync::Arc", "description": "Put the expression into an `Arc`", "scope": "expr" }, "Rc::new": { "postfix": "rc", "body": "Rc::new(${receiver})", "requires": "std::rc::Rc", "description": "Put the expression into an `Rc`", "scope": "expr" }, "Box::pin": { "postfix": "pinbox", "body": "Box::pin(${receiver})", "requires": "std::boxed::Box", "description": "Put the expression into a pinned `Box`", "scope": "expr" }, "Ok": { "postfix": "ok", "body": "Ok(${receiver})", "description": "Wrap the expression in a `Result::Ok`", "scope": "expr" }, "Err": { "postfix": "err", "body": "Err(${receiver})", "description": "Wrap the expression in a `Result::Err`", "scope": "expr" }, "Some": { "postfix": "some", "body": "Some(${receiver})", "description": "Wrap the expression in an `Option::Some`", "scope": "expr" }
} View Crate Graph Source: view_crate_graph.rs Renders the currently loaded crate graph as an SVG graphic. Requires the dot tool, which is part of graphviz, to be installed. Only workspace crates are included, no crates.io dependencies or sysroot crates. Editor Action Name VS Code rust-analyzer: View Crate Graph View Hir Source: view_hir.rs Editor Action Name VS Code rust-analyzer: View Hir View Hir View Mir Source: view_mir.rs Editor Action Name VS Code rust-analyzer: View Mir Workspace Symbol Source: symbol_index.rs Uses fuzzy-search to find types, modules and functions by name across your project and dependencies. This is the most useful feature, which improves code navigation tremendously. It mostly works on top of the built-in LSP functionality, however # and * symbols can be used to narrow down the search. Specifically, Foo searches for Foo type in the current workspace foo# searches for foo function in the current workspace Foo* searches for Foo type among dependencies, including stdlib foo#* searches for foo function among dependencies That is, # switches from "types" to all symbols, * switches from the current workspace to dependencies. Note that filtering does not currently work in VSCode due to the editor never sending the special symbols to the language server. Instead, you can configure the filtering via the rust-analyzer.workspace.symbol.search.scope and rust-analyzer.workspace.symbol.search.kind settings. Editor Shortcut VS Code Ctrl+T

