Minimal Tests Most tests in rust-analyzer start with a snippet of Rust code. These snippets should be minimal -- if you copy-paste a snippet of real code into the tests, make sure to remove everything which could be removed. It also makes sense to format snippets more compactly (for example, by placing enum definitions like enum E { Foo, Bar } on a single line), as long as they are still readable. When using multiline fixtures, use unindented raw string literals: #[test] fn inline_field_shorthand() { check_assist( inline_local_variable, r#"
struct S { foo: i32}
fn main() { let $0foo = 92; S { foo }
}
"#, r#"
struct S { foo: i32}
fn main() { S { foo: 92 }
}
"#, ); } Rationale: There are many benefits to this: less to read or to scroll past easier to understand what exactly is tested less stuff printed during printf-debugging less time to run test Formatting ensures that you can use your editor's "number of selected characters" feature to correlate offsets with test's source code. Marked Tests Use cov_mark::hit! / cov_mark::check! when testing specific conditions. Do not place several marks into a single test or condition. Do not reuse marks between several tests. Rationale: marks provide an easy way to find the canonical test for each bit of code. This makes it much easier to understand. More than one mark per test / code branch doesn't add significantly to understanding. #[should_panic] Do not use #[should_panic] tests. Instead, explicitly check for None, Err, etc. Rationale: #[should_panic] is a tool for library authors to make sure that the API does not fail silently when misused. rust-analyzer is not a library, we don't need to test for API misuse, and we have to handle any user input without panics. Panic messages in the logs from the #[should_panic] tests are confusing. #[ignore] Do not #[ignore] tests. If the test currently does not work, assert the wrong behavior and add a fixme explaining why it is wrong. Rationale: noticing when the behavior is fixed, making sure that even the wrong behavior is acceptable (ie, not a panic). Function Preconditions Express function preconditions in types and force the caller to provide them (rather than checking in callee): // GOOD
fn frobnicate(walrus: Walrus) { ...
} // BAD
fn frobnicate(walrus: Option<Walrus>) { let walrus = match walrus { Some(it) => it, None => return, }; ...
} Rationale: this makes control flow explicit at the call site. Call-site has more context, it often happens that the precondition falls out naturally or can be bubbled up higher in the stack. Avoid splitting precondition check and precondition use across functions: // GOOD
fn main() { let s: &str = ...; if let Some(contents) = string_literal_contents(s) { }
} fn string_literal_contents(s: &str) -> Option<&str> { if s.starts_with('"') && s.ends_with('"') { Some(&s[1..s.len() - 1]) } else { None }
} // BAD
fn main() { let s: &str = ...; if is_string_literal(s) { let contents = &s[1..s.len() - 1]; }
} fn is_string_literal(s: &str) -> bool { s.starts_with('"') && s.ends_with('"')
} In the "Not as good" version, the precondition that 1 is a valid char boundary is checked in is_string_literal and used in foo. In the "Good" version, the precondition check and usage are checked in the same block, and then encoded in the types. Rationale: non-local code properties degrade under change. When checking a boolean precondition, prefer if !invariant to if negated_invariant: // GOOD
if !(idx < len) { return None;
} // BAD
if idx >= len { return None;
} Rationale: it's useful to see the invariant relied upon by the rest of the function clearly spelled out. Control Flow As a special case of the previous rule, do not hide control flow inside functions, push it to the caller: // GOOD
if cond { f()
} // BAD
fn f() { if !cond { return; } ...
} Assertions Assert liberally. Prefer stdx::never! to standard assert!. Rationale: See cross cutting concern: error handling . Getters & Setters If a field can have any value without breaking invariants, make the field public. Conversely, if there is an invariant, document it, enforce it in the "constructor" function, make the field private, and provide a getter. Never provide setters. Getters should return borrowed data: struct Person { // Invariant: never empty first_name: String, middle_name: Option<String>
} // GOOD
impl Person { fn first_name(&self) -> &str { self.first_name.as_str() } fn middle_name(&self) -> Option<&str> { self.middle_name.as_ref() }
} // BAD
impl Person { fn first_name(&self) -> String { self.first_name.clone() } fn middle_name(&self) -> &Option<String> { &self.middle_name }
} Rationale: we don't provide public API, it's cheaper to refactor than to pay getters rent. Non-local code properties degrade under change, privacy makes invariant local. Borrowed owned types (&String) disclose irrelevant details about internal representation. Irrelevant (neither right nor wrong) things obscure correctness. Useless Types More generally, always prefer types on the left // GOOD BAD
&[T] &Vec<T>
&str &String
Option<&T> &Option<T>
&Path &PathBuf Rationale: types on the left are strictly more general. Even when generality is not required, consistency is important. Constructors Prefer Default to zero-argument new function. // GOOD
#[derive(Default)]
struct Foo { bar: Option<Bar>
} // BAD
struct Foo { bar: Option<Bar>
} impl Foo { fn new() -> Foo { Foo { bar: None } }
} Prefer Default even if it has to be implemented manually. Rationale: less typing in the common case, uniformity. Use Vec::new rather than vec![]. Rationale: uniformity, strength reduction. Avoid using "dummy" states to implement a Default. If a type doesn't have a sensible default, empty value, don't hide it. Let the caller explicitly decide what the right initial state is. Functions Over Objects Avoid creating "doer" objects. That is, objects which are created only to execute a single action. // GOOD
do_thing(arg1, arg2); // BAD
ThingDoer::new(arg1, arg2).do(); Note that this concerns only outward API. When implementing do_thing, it might be very useful to create a context object. pub fn do_thing(arg1: Arg1, arg2: Arg2) -> Res { let mut ctx = Ctx { arg1, arg2 }; ctx.run()
} struct Ctx { arg1: Arg1, arg2: Arg2
} impl Ctx { fn run(self) -> Res { ... }
} The difference is that Ctx is an impl detail here. Sometimes a middle ground is acceptable if this can save some busywork: ThingDoer::do(arg1, arg2); pub struct ThingDoer { arg1: Arg1, arg2: Arg2,
} impl ThingDoer { pub fn do(arg1: Arg1, arg2: Arg2) -> Res { ThingDoer { arg1, arg2 }.run() } fn run(self) -> Res { ... }
} Rationale: not bothering the caller with irrelevant details, not mixing user API with implementor API. Functions with many parameters Avoid creating functions with many optional or boolean parameters. Introduce a Config struct instead. // GOOD
pub struct AnnotationConfig { pub binary_target: bool, pub annotate_runnables: bool, pub annotate_impls: bool,
} pub fn annotations( db: &RootDatabase, file_id: FileId, config: AnnotationConfig
) -> Vec<Annotation> { ...
} // BAD
pub fn annotations( db: &RootDatabase, file_id: FileId, binary_target: bool, annotate_runnables: bool, annotate_impls: bool,
) -> Vec<Annotation> { ...
} Rationale: reducing churn. If the function has many parameters, they most likely change frequently. By packing them into a struct we protect all intermediary functions from changes. Do not implement Default for the Config struct, the caller has more context to determine better defaults. Do not store Config as a part of the state, pass it explicitly. This gives more flexibility for the caller. If there is variation not only in the input parameters, but in the return type as well, consider introducing a Command type. // MAYBE GOOD
pub struct Query { pub name: String, pub case_sensitive: bool,
} impl Query { pub fn all(self) -> Vec<Item> { ... } pub fn first(self) -> Option<Item> { ... }
} // MAYBE BAD
fn query_all(name: String, case_sensitive: bool) -> Vec<Item> { ... }
fn query_first(name: String, case_sensitive: bool) -> Option<Item> { ... } Prefer Separate Functions Over Parameters If a function has a bool or an Option parameter, and it is always called with true, false, Some and None literals, split the function in two. // GOOD
fn caller_a() { foo()
