Avoid Allocations Avoid writing code which is slower than it needs to be. Don't allocate a Vec where an iterator would do, don't allocate strings needlessly. // GOOD
use itertools::Itertools; let (first_word, second_word) = match text.split_ascii_whitespace().collect_tuple() { Some(it) => it, None => return,
} // BAD
let words = text.split_ascii_whitespace().collect::<Vec<_>>();
if words.len() != 2 { return
} Rationale: not allocating is almost always faster. Push Allocations to the Call Site If allocation is inevitable, let the caller allocate the resource: // GOOD
fn frobnicate(s: String) { ...
} // BAD
fn frobnicate(s: &str) { let s = s.to_string(); ...
} Rationale: reveals the costs. It is also more efficient when the caller already owns the allocation. Collection Types Prefer rustc_hash::FxHashMap and rustc_hash::FxHashSet instead of the ones in std::collections. Rationale: they use a hasher that's significantly faster and using them consistently will reduce code size by some small amount. Avoid Intermediate Collections When writing a recursive function to compute a sets of things, use an accumulator parameter instead of returning a fresh collection. Accumulator goes first in the list of arguments. // GOOD
pub fn reachable_nodes(node: Node) -> FxHashSet<Node> { let mut res = FxHashSet::default(); go(&mut res, node); res
}
fn go(acc: &mut FxHashSet<Node>, node: Node) { acc.insert(node); for n in node.neighbors() { go(acc, n); }
} // BAD
pub fn reachable_nodes(node: Node) -> FxHashSet<Node> { let mut res = FxHashSet::default(); res.insert(node); for n in node.neighbors() { res.extend(reachable_nodes(n)); } res
} Rationale: re-use allocations, accumulator style is more concise for complex cases. Avoid Monomorphization Avoid making a lot of code type parametric, especially on the boundaries between crates. // GOOD
fn frobnicate(f: impl FnMut()) { frobnicate_impl(&mut f)
}
fn frobnicate_impl(f: &mut dyn FnMut()) { // lots of code
} // BAD
fn frobnicate(f: impl FnMut()) { // lots of code
} Avoid AsRef polymorphism, it pays back only for widely used libraries: // GOOD
fn frobnicate(f: &Path) {
} // BAD
fn frobnicate(f: impl AsRef<Path>) {
} Rationale: Rust uses monomorphization to compile generic code, meaning that for each instantiation of a generic functions with concrete types, the function is compiled afresh, per crate . This allows for exceptionally good performance, but leads to increased compile times. Runtime performance obeys 80%/20% rule -- only a small fraction of code is hot. Compile time does not obey this rule -- all code has to be compiled.

