impl std::fmt::Display for RenameError { fn fmt(&self, f: &mut std::fmt::Formatter<'_>) -> std::fmt::Result { .. }
} // BAD
use std::ops::Deref; impl Deref for Widget { type Target = str; fn deref(&self) -> &str { .. }
} Rationale: overall, less typing. Makes it clear that a trait is implemented, rather than used. Avoid local use MyEnum::* imports. Rationale: consistency. Prefer use crate::foo::bar to use super::bar or use self::bar::baz. Rationale: consistency, this is the style which works in all cases. By default, avoid re-exports. Rationale: for non-library code, re-exports introduce two ways to use something and allow for inconsistency. Order of Items Optimize for the reader who sees the file for the first time, and wants to get a general idea about what's going on. People read things from top to bottom, so place most important things first. Specifically, if all items except one are private, always put the non-private item on top. // GOOD
