} impl Child {
} // BAD
struct Child; impl Child {
} struct Parent { children: Vec<Child>
} impl Parent {
} Rationale: easier to get the sense of the API by visually scanning the file. If function bodies are folded in the editor, the source code should read as documentation for the public API. Context Parameters Some parameters are threaded unchanged through many function calls. They determine the "context" of the operation. Pass such parameters first, not last. If there are several context parameters, consider packing them into a struct Ctx and passing it as &self. // GOOD
fn dfs(graph: &Graph, v: Vertex) -> usize { let mut visited = FxHashSet::default(); return go(graph, &mut visited, v); fn go(graph: &Graph, visited: &mut FxHashSet<Vertex>, v: usize) -> usize { ... }
} // BAD
fn dfs(v: Vertex, graph: &Graph) -> usize { fn go(v: usize, graph: &Graph, visited: &mut FxHashSet<Vertex>) -> usize { ... } let mut visited = FxHashSet::default(); go(v, graph, &mut visited)
} Rationale: consistency. Context-first works better when non-context parameter is a lambda. Variable Naming Use boring and long names for local variables ( yay code completion ). The default name is a lowercased name of the type: global_state: GlobalState. Avoid ad-hoc acronyms and contractions, but use the ones that exist consistently (db, ctx, acc). Prefer American spelling (color, behavior). Default names: res -- "result of the function" local variable it -- I don't really care about the name n_foos -- number of foos (prefer this to foo_count) foo_idx -- index of foo Many names in rust-analyzer conflict with keywords. We use mangled names instead of r#ident syntax: crate -> krate
