fn foo() -> Option<Bar> { if !condition() { return None; } Some(...)
} // BAD
fn foo() -> Option<Bar> { if condition() { Some(...) } else { None }
} Rationale: reduce cognitive stack usage. Use return Err(err) to throw an error: // GOOD
