match ctx.expected_type.as_ref() { Some(expected_type) => completion_ty == expected_type && !expected_type.is_unit(), None => false,
} // BAD
if let Some(expected_type) = ctx.expected_type.as_ref() { completion_ty == expected_type && !expected_type.is_unit()
} else { false
} Rationale: match is almost always more compact. The else branch can get a more precise pattern: None or Err(_) instead of _. Match Ergonomics Don't use the ref keyword. Rationale: consistency & simplicity. ref was required before match ergonomics . Today, it is redundant. Between ref and mach ergonomics, the latter is more ergonomic in most cases, and is simpler (does not require a keyword). Empty Match Arms Use => (), when a match arm is intentionally empty: // GOOD
match result { Ok(_) => (), Err(err) => error!("{}", err),
} // BAD
match result { Ok(_) => {} Err(err) => error!("{}", err),
} Rationale: consistency. Functional Combinators Use high order monadic combinators like map, then when they are a natural choice; don't bend the code to fit into some combinator. If writing a chain of combinators creates friction, replace them with control flow constructs: for, if, match. Mostly avoid bool::then and Option::filter. // GOOD
if !x.cond() { return None;
}
Some(x) // BAD
Some(x).filter(|it| it.cond()) This rule is more "soft" then others, and boils down mostly to taste. The guiding principle behind this rule is that code should be dense in computation, and sparse in the number of expressions per line. The second example contains less computation -- the filter function is an indirection for if, it doesn't do any useful work by itself. At the same time, it is more crowded -- it takes more time to visually scan it. Rationale: consistency, playing to language's strengths. Rust has first-class support for imperative control flow constructs like for and if, while functions are less first-class due to lack of universal function type, currying, and non-first-class effects (?, .await). Turbofish Prefer type ascription over the turbofish. When ascribing types, avoid _ // GOOD
let mutable: Vec<T> = old.into_iter().map(|it| builder.make_mut(it)).collect(); // BAD
let mutable: Vec<_> = old.into_iter().map(|it| builder.make_mut(it)).collect(); // BAD
let mutable = old.into_iter().map(|it| builder.make_mut(it)).collect::<Vec<_>>(); Rationale: consistency, readability. If compiler struggles to infer the type, the human would as well. Having the result type specified up-front helps with understanding what the chain of iterator methods is doing. Helper Functions Avoid creating single-use helper functions: // GOOD
let buf = { let mut buf = get_empty_buf(&mut arena); buf.add_item(item); buf
}; // BAD
let buf = prepare_buf(&mut arena, item); ... fn prepare_buf(arena: &mut Arena, item: Item) -> ItemBuf { let mut res = get_empty_buf(&mut arena); res.add_item(item); res
} Exception: if you want to make use of return or ?. Rationale: single-use functions change frequently, adding or removing parameters adds churn. A block serves just as well to delineate a bit of logic, but has access to all the context. Re-using originally single-purpose function often leads to bad coupling. Local Helper Functions Put nested helper functions at the end of the enclosing functions (this requires using return statement). Don't nest more than one level deep. // GOOD
fn dfs(graph: &Graph, v: Vertex) -> usize { let mut visited = FxHashSet::default(); return go(graph, &mut visited, v); fn go(graph: &Graph, visited: &mut FxHashSet<Vertex>, v: usize) -> usize { ... }
} // BAD
fn dfs(graph: &Graph, v: Vertex) -> usize { fn go(graph: &Graph, visited: &mut FxHashSet<Vertex>, v: usize) -> usize { ... } let mut visited = FxHashSet::default(); go(graph, &mut visited, v)
} Rationale: consistency, improved top-down readability. Helper Variables Introduce helper variables freely, especially for multiline conditions: // GOOD
let rustfmt_not_installed = captured_stderr.contains("not installed") || captured_stderr.contains("not available"); match output.status.code() { Some(1) if !rustfmt_not_installed => Ok(None), _ => Err(format_err!("rustfmt failed:\n{}", captured_stderr)),
}; // BAD
match output.status.code() { Some(1) if !captured_stderr.contains("not installed") && !captured_stderr.contains("not available") => Ok(None), _ => Err(format_err!("rustfmt failed:\n{}", captured_stderr)),
}; Rationale: Like blocks, single-use variables are a cognitively cheap abstraction, as they have access to all the context. Extra variables help during debugging, they make it easy to print/view important intermediate results. Giving a name to a condition inside an if expression often improves clarity and leads to nicely formatted code. Token names Use T![foo] instead of SyntaxKind::FOO_KW. // GOOD
match p.current() { T![true] | T![false] => true, _ => false,
} // BAD match p.current() { SyntaxKind::TRUE_KW | SyntaxKind::FALSE_KW => true, _ => false,
} Rationale: The macro uses the familiar Rust syntax, avoiding ambiguities like "is this a brace or bracket?". Documentation Style inline code comments as proper sentences. Start with a capital letter, end with a dot. // GOOD // Only simple single segment paths are allowed.
MergeBehavior::Last => { tree.use_tree_list().is_none() && tree.path().map(path_len) <= Some(1)
} // BAD // only simple single segment paths are allowed
MergeBehavior::Last => { tree.use_tree_list().is_none() && tree.path().map(path_len) <= Some(1)
} Rationale: writing a sentence (or maybe even a paragraph) rather just "a comment" creates a more appropriate frame of mind. It tricks you into writing down more of the context you keep in your head while coding. For .md and .adoc files, prefer a sentence-per-line format, don't wrap lines. If the line is too long, you want to split the sentence in two :-) Rationale: much easier to edit the text and read the diff, see this link .

